import {nyseUp} from './nyseUp'
import {nyseDown} from './nyseDown'

async function nyseFetch(upArr, downArr) {
         // ------ FETCH NYSE
         const res = await fetch(
            "https://financialmodelingprep.com/api/v3/quotes/nyse?apikey=4d4593bc9e6bc106ee9d1cbd6400b218"
          );
          const dataNyse = await res.json();
          // ----- FILTER TRADABLE SYMBOLS ON NYSE THAT HAVE DROPPED
        await nyseUp(dataNyse, upArr)
        await nyseDown(dataNyse, downArr)

}

module.exports = {nyseFetch}
